(3, '1st Player MIKU Mi7-A BLACK', '(ADD ON FAN)\r\n\r\n1st Player FB 120MM ARGB Fan + Motherboard Sync Hub\r\n\r\n** FB Fan fixed at bottom, must request for REVERSIBLE Fan (for better ventilation)\r\n\r\n\r\n\r\n(SPECIFICATIONS)\r\n\r\nProduct Name : Mi7-A Black\r\n\r\nDimensions (L*W*H) :\r\n\r\n     Structure : 370*235*430 MM\r\n\r\n     Product : 373*235*442 MM\r\n\r\n     Package : 515*295*437 MM\r\n\r\nStructure Thickness : 0.5 MM\r\n\r\nMaterial : \r\n\r\n     SPCC 0.5MM\r\n\r\n     FRONT & LEFT SIDE PANEL: TEMPERED GLASS\r\n\r\nForm Factor : ATX/M-ATX/ITX\r\n\r\nDrive Bays : \r\n\r\n     5.25\"\"CD ROM: 0\r\n\r\n     3.5\"\" HDD: 1+2.5\"\" SSD: 2\r\n\r\nCPU MAX Height : 185 MM\r\n\r\nGPU MAX Length : 360 MM\r\n\r\nI/O : SB3.0*1+USB2.0*1+HD AUDIO\r\n\r\nPCI Card Slot : 7\r\n\r\nFan Supported : \r\n\r\n     TOP: 2*120 MM/2*140 MM\r\n\r\n     REAR: 1*120 MM / 1*140 MM\r\n\r\n     BOTTOM：2*120 MM\r\n\r\nLiquid Cooling : TOP: 24CM (RAM MAX H 40MM)\r\n\r\nPower Supply Support : BOTTOM MOUNT (160MM)\r\n\r\nNet Weight : 5.5KG\r\n\r\nGross Weight : 6.8KG', '189.99', '231', 4),
