(5, 'TENDA TX2 PRO WiFi 6 ', '> 3 years warranty (send back to us or Tenda Malaysia)\r\n\r\n> Replacement model for AC23\r\n\r\n> Compatible with Fiber network like UniFi, Maxis, DiGi, Celcom & other Fiber.\r\n\r\n> Also, can work as access point (AP) or WiFi range extender (repeater)\r\n\r\n> 5 x 6DBi antennas - Best WiFi coverage compared to other WiFi 6 router in same price range.\r\n\r\n> Best for package speed up to 500mbps.\r\n\r\n> FULL parental control, bandwidth control FREE, no subscription fee needed.\r\n\r\n> App or web browser access control locally, OR REMOTELY.\r\n\r\n> OFDMA + MU-MIMO - More devices can be connected to the internet at the same time with lower lag\r\n\r\n> Full GIGABIT Ethernet ports.\r\n\r\n> New generation of Wi-Fi security standard - WPA3, which protects the family\'s network privacy.\r\n\r\n> IPV6, Network Detection, Guest Network, Blacklist/Whitelist, Timer Switch\r\n\r\n', '239.99', '342', 5),
