(9, '🔥HOT ITEM🔥KEROPOK SIRA CAP JUARA/ CAP PIALA SEDAP 7pcs rm10.00', 'Keropok Sira Cap Juara\r\n\r\n🎉 Bersih, halal, dan berkualiti\r\n🎉 Produk Keluaran Bumiputera\r\n🎉 Tahan lama dan mudah di simpan\r\n🎉 Sangat sedap dan pasti akan direpeat order\r\n🎉Sedikit rasa manis dan pedas\r\n🎉 Sesuaai dijadikan hidangaan minum petang & santai\r\n🎉 Sesuai dijadikan goodies', '7.99', '5234', 5),
