(12, 'DJI Mini 3 Pro – Lightweight and Foldable Camera Drone with 4K/60fps Video, 48MP Photo, 34-min Fligh', '[Please Read Before Purchasing] Please be informed that DJI Malaysia will not be responsible for after sales and warranty service on all unauthorized 3rd party sellers’ products. DJI Malaysia is only responsible for after sales and warranty service on all authorized retailers’ products.\r\n\r\n\r\n\r\n*Please take note:\r\n\r\nAll series of DJI Mini 3 Pro and DJI RC come without micro SD card.', '5352', '13', 5),
(13, 'DJI Avata - Camera Drones | Immersive Flight | Intuitive Control | 4K Stabilized Video | Palm-Sized and Agile | Built-in', 'Category\r\nShopee\r\nicon arrow right\r\nCameras & Drones\r\nicon arrow right\r\nDrones & Action Cameras\r\nicon arrow right\r\nDrones\r\nBrand\r\nDji\r\nWarranty Type\r\nManufacturer Warranty\r\nVideo Capture Resolution\r\n4K\r\nWarranty Duration\r\n12 Months\r\nStock\r\n11\r\nShips From\r\nW.P. Kuala Lumpur', '2449', '3', 5),
(14, 'Apple iPhone 13', 'Give business a boost with iPhone 13. Powerful A15 Bionic for incredible performance, so it’s easier to multitask. A big leap in battery life, so you can get more done.\r\n\r\n\r\n\r\nFeatures:\r\n\r\n• A15 Bionic chip for supercharged productivity\r\n\r\n• A big leap in battery life, up to 19 hours of video playback\r\n\r\n• 6.1-inch Super Retina XDR display\r\n\r\n• Most advanced dual-camera system on iPhone\r\n\r\n• Cinematic mode adds shallow depth of field and shifts focus automatically in your videos\r\n\r\n• Durable design with Ceramic Shield\r\n\r\n• Industry-leading IP68 water resistance\r\n\r\n• iOS 15 packs new features to do more with iPhone than ever before\r\n\r\n• Supports MagSafe accessories for easy attach and faster wireless charging\r\n\r\n\r\n\r\nWhat\'s in the box\r\n\r\n- iPhone 13\r\n\r\n- USB-C to Lightning Cable', '3299', '328', 5),
(15, 'Apple iPad 10.2-inch 9th Gen Wi-Fi (2021)', 'Powerful. Easy to use. Versatile. The new iPad has a beautiful 10.2-inch Retina display, powerful A13 Bionic chip, an Ultra Wide front camera with Centre Stage, and works with Apple Pencil and the Smart Keyboard.(1) iPad lets you do more, more easily. All for an incredible value. \r\n\r\n \r\n\r\nKey feature bullets \r\n\r\n•	Gorgeous 10.2-inch Retina display with True Tone \r\n\r\n•	A13 Bionic chip with Neural Engine \r\n\r\n•	8MP Wide back camera, 12MP Ultra Wide front camera with Centre Stage \r\n\r\n•	Up to 256GB storage \r\n\r\n•	Stereo speakers \r\n\r\n•	Touch ID for secure authentication  \r\n\r\n•	802.11ac Wi-Fi and LTE(2) \r\n\r\n•	Up to 10 hours of battery life(3) \r\n\r\n•	Lightning connector for charging and accessories \r\n\r\n•	Works with Apple Pencil (1st generation) and Smart Keyboard(1) \r\n\r\n•	iPadOS 15 is uniquely powerful, easy to use and designed for the versatility of iPad \r\n\r\n \r\n\r\nLegal  \r\n\r\nApps are available on the App Store. Title availability is subject to change. \r\n\r\n(1)Accessories are sold separately. Comp', '1449', '231', 5);
